import React from "react";

export default function About() {
  return (
    <div>
      <p>
        Welcome to SkyFinder, the ultimate destination for finding the best
        deals on flights! Our powerful search engine scours through thousands of
        airlines and travel sites to bring you the cheapest flights available,
        so you can save time and money on your next trip. Whether you're
        planning a weekend getaway or a cross-country adventure, SkyFinder has
        got you covered.
      </p>
    </div>
  );
}
